var plasodir = "/cases/plaso/";
var plasoname = msg.dirname.replace('processor', 'plaso');
msg.l2tcli = "/:/data log2timeline/plaso log2timeline.py --status_view none --parsers \"filestat,winreg,esedb,binary_cookies,chrome_cache,chrome_preferences,custom_destinations,czip,firefox_cache,firefox_cache2,java_idx,jsonl,lnk,mcafee_protection,msiecf,olecf,opera_global,opera_typed_history,pe,prefetch,recycle_bin,recycle_bin_info2,sqlite,symantec_scanlog,text,trendmicro_url,trendmicro_vd,windefender_history,winevt,winevtx,winjob\" --storage-file" + " "+ "/data" + plasoname + ".plaso" + " " + "/data" +msg.unzipdir;
return msg;

var plasofullpath = "/cases/plaso/"+ msg.plasofname + ".plaso";
msg.tsimport = "-u user -p pass --host http://127.0.0.1 --timeline_name " + msg.plasofname + "-triage" + " --sketch_id " + "1" + " " + plasofullpath;
return msg;

//Setting up directory path of the file upload
msg.config ={}
msg.config.start = msg.filedir

//Setting up vars to handle archive decompress operations
var filenameUpper = msg.file.split(".")[0];
var filename = filenameUpper.toLowerCase();
msg.tstamp = new Date().toISOString().substring(0,19).replace(/-/g,"").replace(/:/g,"");
var dirnameUpper = filename + msg.tstamp + "Z";
msg.dirname = dirnameUpper.toLowerCase();
msg.plasofname = msg.dirname;
//msg.filename = msg.payload;

//Setting up decompress parameters
msg.unzipdir = msg.filedir + '/' + msg.dirname;
msg.unzipcli = "-qo " + msg.filename + " -d " + msg.unzipdir;
msg.sevzipcli = " x " + msg.filename + " -o" + msg.unzipdir;
msg.targzcli = " xzf " + msg.filename + " -C " + msg.unzipdir;
msg.tarbz2cli = " xjf " + msg.filename + " -C " + msg.unzipdir;
msg.unrarcli = "x " + msg.filename + " " + msg.unzipdir;

return msg;

//Create a variable to store the EVTX directory path
msg.winevt = msg.dirname + '/C/Windows/System32/winevt/';
msg.hayabusa_job = msg.plasofname + '-hayabusa';
msg.hayabusa_out = '/cases/evtxproc/' + msg.hayabusa_job;
msg.hayabusa_exec =  ' csv-timeline -d ' +msg.winevt+ ' --RFC-3339 -o' + msg.hayabusa_out + '.csv' + ' -p timesketch-verbose -U'
msg.hayabusa_ts = "-u user -p pass --host http://127.0.0.1 --timeline_name " + msg.hayabusa_job + " --sketch_id " + "1 " + msg.hayabusa_out + '.csv';
return msg;
